    "mail_modal.spi.mail_body": {
      "ja": "WEBでの適性検査(SPI3)の受検をお願いいたします。\n本メールは受検が終わるまで、大切に保管してください。\n\n検査の所要時間は、約30分です。\n※事前の環境確認の時間は含まれておりません。\n　時間に余裕をもって受検いただくことをお勧めいたします。\n\nお問い合わせ先\n・検査実施に関するお問い合わせ：ＷＥＢテストヘルプデスク\n　お問い合わせ時に「カオナビの受検です」とお伝えください。\n　（検査内容に関する質問についてはお答えできません。）\n　TEL：0570-012921（受付時間　9:00～18:00/土日祝含む毎日）\n・受検期限延長や完了後再受検に関するお問い合わせ：人事担当",
      "en": "Please take the web-based aptitude test (SPI3). \\Please keep this e-mail until you finish taking the test. \\The time required for the test is approximately 30 minutes. \\ЈnIt does not include the time for environmental confirmation in advance. \nIt is recommended that you allow plenty of time for the inspection. \\Contact information for inquiries regarding the test: Web Test Help Desk \n（We are unable to answer questions regarding the content of the test.) \n TEL：0570-012921（Hours: 9:00～18:00/every day including Saturdays, Sundays and national holidays） \n・Inquiries about extending the deadline for taking the test or re-taking the test after completion: Human Resources",
      "zhCN": "请参加基于网络的能力测试（SPI3）。 \\请保留这封邮件，直到你完成测试。 \\测试所需时间约为30分钟。 \\这还不包括初步环境检查所需的时间。 \\建议你为检查留出足够的时间。 \\查询的联系信息：Web Test Helpdesk 在进行查询时，请说明你正在参加kaonavi测试。 \\我们不能回答关于测试内容的问题。 \\TEL：0570-012921（接待时间：9:00-18:00/每天，包括周六、周日和公共假期） （n・关于延长考试期限或完成后重新考试的查询：HR",
      "zhTW": "請參加在線能力測試 (SPI3)。 \n在考試結束之前，請妥善保管此郵件。 \n\n檢查大約需要 30 分鐘。 \n *不包括提前檢查環境的時間。 \n‖我們建議您在參加考試時留出充足的時間。 \n\n諮詢\n・關於考試實施的諮詢：網絡考試服務台\n聯繫我們時請告知您正在參加kaonavi考試。 \n〉（無法回答有關考試內容的問題。）\n〉TEL：0570-012921（受理時間：9:00-18:00/週六、週日、節假日除外）\n・延期諮詢參加考試和完成後重新參加考試的截止日期：人力資源"
    },
