    "manual.android.default_browser.browser_name": {
      "ja": "Android標準Webブラウザ",
      "en": "Android Standard Web Browser",
      "zhCN": "Android标准Web浏览器",
      "zhTW": "Android標準網路瀏覽器"
    },
    "manual.android.default_browser.regist.title": {
      "ja": "クライアント証明書を、Android標準のWebブラウザに登録する方法を説明します。",
      "en": "Describe how to register a client certificate in Android Standard Web Browser.",
      "zhCN": "下面说明如何将客户端证书导入到Android标准的Web浏览器中。",
      "zhTW": "以下為您說明Android標準網路瀏覽器的用戶端憑證登錄方法。"
    },
    "manual.android.default_browser.regist.procedure_premise": {
      "ja": "お使いのAndroid端末によって、手順が異なる場合があります。<br />また、端末の種類やOSのバージョンによっては、クライアント証明書の登録の際に画面ロックの設定が必要な場合があります。<br />端末の操作やボタン名の詳細は、各端末の取扱説明書を参照してください。<br />※バージョン 4未満のAndroidでは、クライアント証明書を登録できません。",
      "en": "The procedure may be different for each Android terminal you use.<br />And also, depending on the type of Android terminal and OS version, <br />[Lock screen] settings may be necessary when registering the client certificate.<br />Please refer to the instruction manual of each android terminal for details of operation on the terminal and button name, etc.<br />※On Android under version 4, you can not register client certificate.",
      "zhCN": "根据您使用的Android设备，步骤可能会有所不同。<br />此外，根据设备类型和系统版本，导入客户端证书时可能需要设置锁屏密码。<br />设备操作方法及按钮名称等详细信息，请参阅各设备的使用说明书。<br />※Android 4以下版本的系统无法导入客户端证书。",
      "zhTW": "隨著您使用的Android 裝置不同，步驟可能會有差異。<br />此外，視您的裝置種類或作業系統版本，登錄用戶端憑證時可能會需要設定螢幕鎖。<br />裝置的操作及按鈕詳細名稱，請參閱各裝置的使用說明書。<br />※版本4以下的Android，恕無法登錄憑證。"
    },
    "manual.android.default_browser.regist.procedure_1": {
      "ja": "「クライアント証明書をダウンロード」をクリックし、証明書ファイルをダウンロードします。",
      "en": "Click \"Download client certificate\", and download the certificate file.",
      "zhCN": "点击“下载客户端证书”，下载证书文件。",
      "zhTW": "點擊「下載用戶端憑證」，下載憑證檔。"
    },
    "manual.android.default_browser.regist.procedure_2": {
      "ja": "システム管理者から、クライアント証明書のパスワードを入手する",
      "en": "You receive the password of the client certificate from the system administrator.",
      "zhCN": "从系统管理员处获取客户端证书密码",
      "zhTW": "由系統管理員獲取用戶端憑證密碼。"
    },
    "manual.android.default_browser.regist.procedure_3": {
      "ja": "クライアント証明書のパスワードを入力し、[OK]をタップする",
      "en": "Enter the password of the client certificate, and tap \"OK\".",
      "zhCN": "输入客户端证书的密码，然后点击[OK]",
      "zhTW": "輸入用戶端憑證密碼，點擊 [OK]"
    },
    "manual.android.default_browser.regist.procedure_4": {
      "ja": "クライアント証明書に名前を設定（そのままでも問題ありません）し、[OK]をタップする",
      "en": "Set name on client certificate (No problem even without change), tap [OK].",
      "zhCN": "设置客户端证书的名称（保持默认也没问题），然后点击[OK]",
      "zhTW": "於用戶端憑證設定姓名（維持原狀亦沒問題），點擊 [OK]"
    },
    "manual.android.default_browser.regist.procedure_5": {
      "ja": "端末のパターン、PIN、またはパスワードを設定していない場合は、設定を求めるメッセージが表示される場合があります。",
      "en": "If you do not set the PIN/Pattern/Password, you may be dialoged for the setting.",
      "zhCN": "如果设备没有设置锁定图案、PIN、或密码，可能会出现要求设置的提示。",
      "zhTW": "若未設定裝置模式、PIN、或密碼，可能會跳出需進行設定的訊息。"
    },
    "manual.android.default_browser.regist.procedure_6": {
      "ja": "Android端末で、Android標準Webブラウザを起動し、URL欄にアクセスするURLを入力する<br /><span class=\"break-word\">（https://service-secure.kaonavi.jp）</span><br />Android標準Webブラウザで使用するクライアント証明書を選択し、ラジオボタンをタップする",
      "en": "Launch Android Web Browser, and enter URL to access the page.<br /><span class=\"break-word\"> (https://service-secure.kaonavi.jp)</span><br />Select the client certificate to use with the Android Web Browser, and tap the radio button.",
      "zhCN": "在Android设备上，启动Android标准Web浏览器，在地址栏输入要访问的地址<br /><span class=\"break-word\">（https://service-secure.kaonavi.jp）</span><br />在Android标准Web浏览器中选择要使用的客户端证书，点击单选按钮",
      "zhTW": "於Android裝置啟動Android標準網路瀏覽器，並於網址欄中輸入欲存取的網址<br /><span class=\"break-word\">（https://service-secure.kaonavi.jp）</span><br />於Android標準網路瀏覽器選擇欲使用的用戶端憑證，並點擊單選框"
    },
    "manual.android.default_browser.regist.procedure_7": {
      "ja": "次の画面は初回アクセス時のみに表示されます。二回目以降は、手順8のURLにアクセスしても、クライアント証明書の選択操作はありません。",
      "en": "The next dialog is displayed only on the first access. After the second time, <br />even if you access the URL of step 8, there is no operation to select client certificate.",
      "zhCN": "下面的页面仅在首次访问时显示。访问一次之后，即使再次访问步骤8中的地址，也无法选择客户端证书。",
      "zhTW": "以下畫面僅會在首次存取時顯示。第二次以後，即便存取步驟 8 的網址，亦不需選擇用戶端憑證。"
    },
