      "ja": "ユーザーの閲覧/編集権限を定めるロールを作成できます。<br>役員ロールや部門長ロール、一般職ロールなど、役割に応じて細かく閲覧・編集範囲を設定することができるので、多様なユーザーにログイン権限を付与し、必要な情報のみ開示して活用することができます。",
