    "setup.permission_extend.modal.help.text": {
      "ja": "ユーザーごとに閲覧可能メンバー・所属、もしくは閲覧不可メンバー・所属を個別設定できます。<br>所属マスターに基づく所属社員、配下社員とは別に、自身の所属とは関係のないメンバーや部署に対して閲覧・参照権限を付与したいユーザーに設定することで、より柔軟なアクセス権限の設定が可能です。",
      "en": "By setting the belonging employee privileges and the subordinate employee privileges based on the department master, and <br />by setting the viewing privileges of members and departments that are not related to their department, <br />more flexible access authority can be set.",
      "zhCN": "可以为每个用户单独设置可查看的成员、归属，或是不可查看的成员、归属。<br>除基于归属Master的归属员工、下属员工外，还可以为用户赋予与自身归属关系无关的成员或部门的查看、参阅权限，以更灵活地设置访问权限。",
      "zhTW": "可個別設定每個用戶可瀏覽的成員、隸屬或不可瀏覽的成員、隸屬。<br>除了根據隸屬主管理的隸屬員工、下屬外，還可透過設定讓用戶擁有權限瀏覽、參閱跟自身隸屬無關的成員、單位，使訪問權限設定更加有彈性。"
    },
