      "ja": "より安心な運用のためにログデータを収集。内部統制での活用や、不正利用の有無をチェックすることも可能です。\nさらに操作ミスによるデータ破損や削除に備えたリスク対策も実現可能です。",
      "en": "Collects log data for more secure operation.\nIt can also be used for internal control and to check for unauthorized use.\nIn addition, risk countermeasures against data damage or deletion due to operational errors can also be realized.",
      "zhCN": "收集日志数据以实现更安全地使用。也可以用于内部控制，检查是否有未经授权的使用。\n此外，还可以实施风险对策，防止因操作失误造成的数据损坏或删除。",
      "zhTW": "採集訪問日誌讓您放心使用。亦可活用於內部管理、檢查是否有不當使用。\n亦可進一步實現因應操作錯誤造成數據損壞、刪除的風險應對。"
