    "share.mail_def.sr_action.proceed.body": {
      "ja": "----------------------------------------------------\nこのメールは、システムから自動送信されています。\n送信専用のアドレスから配信されているので、返信することはできません。\n----------------------------------------------------\n\n【指定参加者名】さん\n\n【イベント名】に関してお知らせです。\n\n【対象者名】さんの【イベント名】について、ステータスが更新されました。\n以下のURLにアクセスして、【次のアクション名】の操作を行ってください。\n\n【評価イベントURL】\n\n【URL案内文】\n\n自動配信メール",
      "en": "----------------------------------------------------\nThis mail is sent automatically from the system.\nYou can't reply this, since it was sent from send-only address.\n----------------------------------------------------\n\n[指定参加者名]\n\nThis is a notfication regarding  [Event Title].\n\n[対象者名] 's status in the [Event Title] process has been updated.\nPlease complete your next action by accessing the following URL.\n\n[EVENT URL]\n\n[URL案内文]\n\n- Automatically notification mail",
      "zhCN": "----------------------------------------------------\n这封邮件由系统自动发送。\n因为是发送邮件专用的地址，所以无法回复\n----------------------------------------------------\n\n和【指定参与者姓名】先生/女士【评估调查表名称】有关的通知。\n\n【被评估方姓名】先生/女士的【评估调查表名称】，状态已更新。\n请访问下面的URL，进行【下一个活动行为名称】的操作。\n\n【评估调查表URL】\n\n【URL指南】\n\n自动发送邮件",
      "zhTW": "----------------------------------------------------\n此郵件為系統自動發送\n此為發送專用網址，故無法回信。\n----------------------------------------------------\n\n【指定參加人姓名】君\n\n【活動名稱】相關通知。\n\n【目標人姓名】君的【活動名稱】狀態已更新。\n請進入以下網址，並執行【下個操作】操作。\n\n【評估活動網址L】\n\n【網址說明文字】\n\n自動發送郵件"
    },
