      "en": "----------------------------------------------------\nThis mail is sent automatically from the system.\nYou can't reply this, since it was sent from send-only address.\n----------------------------------------------------\n\n[:sr_cast_member_name]\n\nThis is a notfication regarding  [:sr_event_name].\n\n[:sr_target_member_name]'s status in the [:sr_event_name] process has been retracted.\nPlease complete your action by accessing the following URL.\n\n[:url]\n\n[:url_guide]\n\nThe following, the comment of retract:\n----------------------------------------------------\n[:sr_back_remark]\n----------------------------------------------------\n\n- Automatically notification mail",
      "zhCN": "----------------------------------------------------\n这封邮件由系统自动发送。\n因为是发送邮件专用的地址，所以无法回复\n----------------------------------------------------\n\n和【指定参与者姓名】先生/女士【评估调查表名称】有关的通知。\n\n关于【被评估方姓名】男士/女士的【评估调查表名称】，【退回的评估调查表名称】被退回。\n请访问下面的URL，进行【下一个活动行为名称】的操作。\n\n【评估调查表URL】\n\n【URL指南】\n\n以下评论被退回\n----------------------------------------------------\n【退回理由】\n----------------------------------------------------\n\n自动发送邮件",
      "zhTW": "----------------------------------------------------\n此郵件為系統自動發送\n此為發送專用網址，故無法回信。\n----------------------------------------------------\n\n【指定參加人姓名】君\n\n【活動名稱】相關通知。\n\n【目標人姓名】君的【活動名稱】相關【退回操作名】已退回。\n請進入以下網址，並執行【下個操作】操作。\n\n【評估活動網址】\n\n【網址說明文字】\n\n以下為退回評語\n----------------------------------------------------\n【退回原因】\n----------------------------------------------------\n\n自動發送郵件"
