    "share.mail_def.sr_action.back_self.body": {
      "ja": "----------------------------------------------------\nこのメールは、システムから自動送信されています。\n送信専用のアドレスから配信されているので、返信することはできません。\n----------------------------------------------------\n※こちらは「自分へのメール・通知送信」にチェックをつけた際に送付される確認メールとなります。\n\n【指定参加者名】さん\n\n【イベント名】に関してお知らせです。\n\n【対象者名】さんの【イベント名】について、\n【差し戻しアクション名】が差し戻されました。\n\n差し戻しコメントに関しては以下をご確認ください。\n\n以下、差し戻しコメント\n----------------------------------------------------\n【差し戻し理由】\n----------------------------------------------------\n\n自動配信メール",
      "en": "----------------------------------------------------\nThis mail is sent automatically from the system.\nYou can't reply this, since it was sent from send-only address.\n----------------------------------------------------\n* This email is a confirmation email to yourself.\n\n[:sr_cast_member_name]\n\nThis is a notfication regarding  [:sr_event_name].\n\n[:sr_target_member_name]'s status in the [:sr_event_name] process has been retracted.\n\nPlease check the following for retraction comments.\n\nThe following, the comment of retract:\n----------------------------------------------------\n[:sr_back_remark]\n----------------------------------------------------\n\n- Automatically notification mail",
      "zhCN": "----------------------------------------------------\n这封邮件由系统自动发送。\n因为是发送邮件专用的地址，所以无法回复\n----------------------------------------------------\n※这是在确认\"发送给自己的邮件、通知\"时收到的确认邮件。\n\n关于【指定参与者姓名】先生/女士\n\n【评估调查表名称】的通知。\n\n关于【被评估方姓名】先生/女士的【评估调查表名称】，\n【退回的活动行为名称】被退回。\n\n关于退回的评论请确认以下内容。\n\n以下被退回的评论\n----------------------------------------------------\n【退回理由】\n----------------------------------------------------\n\n自动发送邮件",
      "zhTW": "----------------------------------------------------\n此郵件為系統自動發送\n此為發送專用網址，故無法回信。\n----------------------------------------------------\n※此為勾選「發送郵件、通知給自己」時發送的確認郵件。\n\n【指定參加人姓名】君\n\n【活動名稱】相關通知。\n\n【目標人姓名】君的【活動名稱】相關\n【退回操作】已退回。\n\n請於下方確認退回評語。\n\n以下為退回評語\n----------------------------------------------------\n【退回原因】\n----------------------------------------------------\n\n自動發送郵件"
    },
