    "user.synapse_tree.modal.help.caption": {
      "ja": "所属ツリー上に顔写真が並ぶ、<br />組織図機能です。",
      "en": "It is a organization chart function that you can arrange departments and members, freely.",
      "zhCN": "在部门信息树上排列着肖像照，<br />具有组织图的功能。",
      "zhTW": "此功能是將大頭照排列於隸屬樹狀圖上的<br />組織圖功能。"
    },
    "user.synapse_tree.modal.help.text": {
      "ja": "組織図ごとに所属長とメンバーの顔写真が並び、社内の組織状態を直観的に把握できます。<br /><br />さらに、組織図上で顔写真を並び替え、<br />異動や来期の新組織のシミュレーションを行うことも可能。<br /><br />配置や抜擢など、組織検討に役立ちます。",
      "en": "For each department, you can view the leader and the member's photos. <br />So, you can intuitively grasp the department structures and the members of the organization.<br /><br />Furthermore, It is also possible to simulate a new organization <br />by moving the departments or members on the organization tree. <br /><br />It is useful for organization meetings, such as employee movement and employee arrangement.",
      "zhCN": "每个组织图都排列着该部门领导和成员的肖像照，可以直观地把握公司内的组织状态。<br /><br />并且，也可以在组织图上重新排列肖像照，<br />进行人事调动和下一期的新组织的模拟。<br /><br />有助于包括部署和提拔在内的组织讨论。",
      "zhTW": "將隸屬長官及成員的大頭上排列每張組織圖上，便能以直覺掌握公司內部的組織樣態。<br /><br />而且將大頭照於組織圖上重新排列，<br />亦可進行異動及下期的新組織模擬。<br /><br />對組織配置及升遷等組織檢討也很有幫助。"
    },
