      "ja": "※回答者を匿名とした「匿名イベント」の場合、作成者および管理者も回答者を特定することはできません。回答受付後、一人でも回答者がいた場合、ステータスを開始前に戻すことはできません。匿名アンケートについて詳しくは",
      "en": "For anonymous events, even the administrator cannot identify the respondents. If there is even one respondent, the status cannot be restored to the way it was before the event started.",
