      "en": "<div class=\"color-gray\" style=\"text-align:center\">Would you like to save <span class=\"color-black\">':action_name'</span>, and send notification to the target members?</div>",
      "zhCN": "<div class=\"color-gray\" style=\"text-align:center\"><span class=\"color-black\">:action_name</span>确定后<br />是否要向在对象内的参与者发送电子邮件和通知？</div>",
