    "user.smart_review.edit_form.popup_part_help_tip.part_explain.part_type_6": {
      "ja": "決まったテキストを表示させる場合に使用します。\nタイトルや見出し、入力補助や注意点など、\n入力枠を必要としないテキスト情報に利用できます。\nまた外部サイトへのリンクを設置したり、\nフォーム内リンクで目次を作ったりできます。",
      "en": "Message parts can be inserted.\nIt can be used for text information that does not require an input frame, such as titles, headings, input aids, and notes.\nLinks to external sites can be placed, and links within a page can be added to create a table of contents.",
      "zhCN": "用于显示确定的文本。\n可以用于不需要输入框的文本信息，\n例如标题、目录、辅助输入和注意事项等。\n另外，可以设置到外部网站的链接，\n也可以通过表格内的链接制作目录。",
      "zhTW": "用於顯示固定文字。\n可用於題目及標題、輸入輔助及注意事項等、\n不需要入力框的文字資訊。\n此外也可設定前往外部網站的連結，\n或於表單內以連結製作目次。"
    },
