    "user.smart_review.edit_form.popup_part_help_tip.part_explain.part_type_10": {
      "ja": "四則演算等の計算結果を表示する項目に使います。\nナンバーボックスやプルダウンリストに\n入力されたデータをもとに、\n設定された条件で計算を実行します。\n\n計算式の例1：通常の四則演算の例\n(100-[ウェイト])*([評価点]+[上司評価点])/2\n\n計算式の例2：COUNTIF関数の例\nCOUNTIF(50=>,[評価点],[上司評価点])",
      "en": "Calculation formula parts can be inserted. Function is available.\nBased on the data entered in the number box or pull-down list, the calculation is executed according to the set conditions.\n\nExample 1\n(100-[weight])*([evaluation point]+[supervisor evaluation point])/2\n\nExample 2\nCOUNTIF(50=>,[evaluation points],[supervisor evaluation points])",
      "zhCN": "用于显示四则运算等计算结果的项目。\n根据在数值框或下拉菜单中\n输入的数据为基础\n设置的条件进行计算。\n\n计算公式例1：常规四则运算示例\n(100-[权重])*([评分]+[上级评分])/2\n\n计算公式例2：COUNTIF函数示例\nCOUNTIF(50=>[评分],[上级评分])",
      "zhTW": "用於顯示四則運算等計算結果。\n根據數字框及下拉清單中\n輸入的數據，\n以所設定的條件執行運算。\n\n算式範例 1：以一般四則運算為例\n(100-[權重]]])*([評分]+[上司評分])/2\n\n算式範例2：COUNTIF 係數範例\nCOUNTIF(50=>,[評分],[上司評分])"
    },
    "user.smart_review.edit_form.popup_part_help_tip.part_explain.part_type_10_support_site_url": {
      "ja": "https://support.kaonavi.jp/scene-function/smart-review/004-04#formula",
      "en": "https://support.kaonavi.jp/scene-function/smart-review/004-04#formula",
      "zhCN": "https://support.kaonavi.jp/scene-function/smart-review/004-04#formula",
      "zhTW": "https://support.kaonavi.jp/scene-function/smart-review/004-04#formula"
    },
    "user.smart_review.edit_form.popup_part_help_tip.part_explain.part_type_11": {
      "ja": "PROFILE BOOKのデータや他イベントのデータを\n参照し、表示することができます。\n『対象者』『参加者』の所属部署や氏名などの\n基本情報やシートに登録された情報、他イベントの値や\n文章を自動表示するのに利用します。\n\n参照タグの例：\n#<対象者>#<基本情報>#<氏名>",
      "en": "Reference Tag parts can be inserted. PROFILE BOOK and other event data can be displayed.\nBasic information such as the department and name of the \"Assessee\" and \"Assessor\", information registered in the sheet, and values and sentences from other events can be referenced and displayed.\n\nExamples of reference tags\n#<Assessee>#<Basic Info>#<Full name>",
      "zhCN": "支持参照\nPROFILE BOOK的数据和其他评估调查表的数据，然后显示。\n用于自动显示“被评估方”、“参与者”所属部门和姓名等\n基本信息和注册在表单的信息、其他评估调查表的值和\n文章。\n\n参考标签示例：\n#<対象者>#<基本情報>#<氏名> or #<Assessee>#<Basic Info>#<Full name>",
      "zhTW": "可參閱 PROFILE BOOK 數據及其他活動數據\n並進行顯示。\n用於自動顯示「目標對象」、「參加人」的隸屬單位及姓名等\n登錄於基本資訊及工作表的資訊、其他活動數值或\n文章。\n\n參閱標籤範例：\n#<対象者>#<基本情報>#<氏名> or #<Assessee>#<Basic Info>#<Full name>"
    },
    "user.smart_review.edit_form.popup_part_help_tip.part_explain.part_type_11_support_site_url": {
      "ja": "https://support.kaonavi.jp/scene-function/smart-review/004-04#reftag",
      "en": "https://support.kaonavi.jp/scene-function/smart-review/004-04#reftag",
      "zhCN": "https://support.kaonavi.jp/scene-function/smart-review/004-04#reftag",
      "zhTW": "https://support.kaonavi.jp/scene-function/smart-review/004-04#reftag"
    },
    "user.smart_review.edit_form.popup_part_help_tip.part_explain.part_type_12": {
      "ja": "条件となる値によって、違う結果を表示する項目に使います。\n点数によって評価ランクが決まる、などの場合に利用できます。\n\n判定式の記入例①\n[評価点]>=100,S\n[評価点]<100,A\n[評価点]<80,B\n[評価点]<60,C\n\n－解説①\n評価点が100点以上だったらS\n評価点が80点以上100点未満だったらA …\n\n判定式の記入例②\n[役職]='マネージャー', マネージャーの評価項目はaaaaaです。\n[役職]='リーダー', リーダーの評価項目はbbbbbです。\n[役職]='スタッフ', スタッフの評価項目はcccccです。\n\n－解説②\n役職がマネージャーだったら\n「マネージャーの評価項目はaaaaaです。」と表示する",
      "en": "Judgment parts can be inserted.\nIt is used for items that display different results depending on the conditions.\nThis can be used when the evaluation rank is determined by the score.\n\nExample 1\n[Rating score]>=100,S\n[Rating points]<100,A\n[Evaluation points]<80,B\n[Rating point]<60,C\n\nExplanation of Example 1\nS if the score was 100 or more\nA if the score is between 80 and 100 ...\n\nExample 2\n[job title]='manager', the manager's evaluation item is aaaa.\n[Position]='Leader', The leader's rating is bbbbbbb.\n[Position]='Staff', The evaluation item for staff is cccccc.\n\nExplanation of Example 2\nIf the position was manager, then \"The manager's evaluation item is aaaaa.\" is displayed.",
      "zhCN": "用于根据条件值的不同，显示不同结果的项目。\n根据分数决定评级等情况下可以使用。\n\n判别式填写例①\n[评分]>=100,S\n[评分]<100,A\n[评分]<80,B\n[评价点]<60，C\n\n－解说①\n如果评分在100分以上，则S\n如果评分在80分以上且不足100分，则A…\n\n判别式填写例②\n[职务]=‘经理’，经理的评价项目是aaaaa。\n[职务]=‘领导’，领导的评价项目是bbbbb。\n[职务]=“员工”，员工的评价项目为ccccc。\n\n－解说②\n如果职务是经理\n”经理的评价项目是aaaaa。”显示",
      "zhTW": "用於顯示隨條件值不同，出現不同結果的項目。\n可用於依分數決定評估等級等情形。\n\n判斷公式填寫範例①\n[評分]>=100,S\n[評分]<100,A\n[評分]<80,B\n[評分]<60,C\n\n－說明①\n評分100分以上為S\n評分80分以上不到100分為A …\n\n判斷公式填寫範例②\n[職稱]='經理', 經理的評估項目為aaaaa。\n[職稱]='',組長的評估項目為bbbbb。\n[職稱]='工作人員', 工作人員評估項目。\n\n－說明②\n若職稱為經理\n以「經理的評估項目為。」來顯示"
    },
