    "user.smart_review.edit_form.popup_part_help_tip.part_explain.part_type_16": {
      "ja": "対象者詳細画面に開閉ボタンが設けられ、登録されたパーツを一括で開閉することができます。\n「評価に関する説明欄」や「任意選択項目の解答欄」といった「常時表示する必要性が低いパーツ」を閉じておきたい時に利用します。",
      "en": "If an expand button has been created on the target details screen, the parts that have been added can be expanded and collapsed all at once.\nUse this when you want to collapse parts that do not always need to be dispayed such as an \"evaluation explanation column\" or \"answer column for optional items\".",
      "zhCN": "对象详情画面设有开关按钮，可批量开启或关闭已添加的部件。\n可用于关闭“评价相关的说明栏”或“任意选择项目的解答栏”等“无需时刻显示的部件”。",
      "zhTW": "於指定的詳情畫面設置開闔按鈕，便能統一控制已登錄部件的開闔狀態。\n可用來隨手關閉「評價相關說明欄」、「任選項目解答欄」等「毋須經常顯示的部件」。"
    },
